  W += c[12] * 16.043000;  // CH4
  W += c[13] * 29.018000;  // HCO
  W += c[14] * 30.026000;  // CH2O
  W += c[15] * 28.010000;  // CO
  W += c[16] * 44.009000;  // CO2
