  W += c[25] * 43.089000;  // nC3H7
  W += c[26] * 56.064000;  // C2H3CHO
  W += c[27] * 55.100000;  // C4H7
  W += c[28] * 56.108000;  // C4H81
  W += c[29] * 57.116000;  // pC4H9
  W += c[30] * 69.127000;  // C5H9
  W += c[31] * 70.135000;  // C5H10
  W += c[32] * 71.143000;  // PXC5H11
  W += c[33] * 84.162000;  // C6H12
  W += c[34] * 85.170000;  // PXC6H13
  W += c[35] * 98.189000;  // C7H14
  W += c[36] * 99.197000;  // PXC7H15
  W += c[37] * 112.216000; // C8H16
  W += c[38] * 113.224000; // PXC8H17
  W += c[39] * 126.243000; // C9H18
  W += c[40] * 127.251000; // PXC9H19
  W += c[41] * 140.270000; // C10H20
  W += c[42] * 141.278000; // PXC10H21
  W += c[43] * 169.332000; // PXC12H25
  W += c[44] * 169.332000; // SXC12H25
  W += c[45] * 169.332000; // S3XC12H25
