          (3.6 - 1) * sc[16];
  // forward
  phi_f = (sc[3] * sc[3]);
  k_f = 111000000 * exp(-0.37 * tc[0] - 0.50321666580472 * (0) * invT);
  dlnkfdT = -0.37 * invT + 0.50321666580472 * (0) * invT2;
  // pressure-fall-off
  k_0 = 2.01e+17 * exp(-0.584 * tc[0] - 0.50321666580472 * (-2293) * invT);
  Pr = 1e-12 * alpha / k_f * k_0;
