  phi_r = sc[14];
  Kc = refCinv * exp(g_RT[5] - g_RT[14] + g_RT[15]);
  k_r = k_f / Kc;
  dlnKcdT = invT * (-(h_RT[5] + h_RT[15]) + (h_RT[14]) + 1.000000);
